export default function sketch(p){

let angle = 0;

    p.setup = () => {
      p.createCanvas(400, 400);
    }

    p.draw = () => {
      /*p.background(220,0,200);*/
      p.translate(width / 2, height / 2)
      rectMode(CENTER);

      let h = 100;
      rect(0, 0, 10, h);

      angle += 0.1;
    };

};
